import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Content,IconButton } from 'react-mdl';
import { NavLink  } from 'react-router-dom';
import { Grid, Cell } from 'react-mdl'
import Resume  from './components/resume'
import Landing from './components/landingpage'
import Projects from './components/projects';

import AboutMe from './components/aboutme';
import Contact from './components/contact';
import { StickyContainer, Sticky } from 'react-sticky';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      typeOfID: ''
    };
  }
  handleChangeProject() {
    this.setState({ typeOfID: 'projects' });
  }
  render(){
  return (


    <div className="demo-big-content">
      <Layout>
      <StickyContainer>
        {/* Other elements can be in between `StickyContainer` and `Sticky`,
        but certain styles can break the positioning logic used. */}
        <Sticky>
          {({
            style,

            // the following are also available but unused in this example
            isSticky,
            wasSticky,
            distanceFromTop,
            distanceFromBottom,
            calculatedHeight
          }) => (
        <Header scroll className="header-color" title={<a style={{ textDecoration: 'none', color: 'white' }} href="#landing">Neeraj Singhi</a>} >

          <Navigation  ripple activeTab={1} onChange={(tabId) => {}}>
            <a className={this.state.typeOfID === 'projects' ? 'selected':''} href="#projects" >Projects</a>
            <a className={this.state.typeOfID ==='aboutme' ? 'selected':''} href="#aboutme" >About Me</a>
            <a className={this.state.typeOfID === 'contact' ? 'selected':''} href="#contact" >Contact</a>
          </Navigation>
          <IconButton>
          <i class="fa fa-code" id="facolor" aria-hidden="true"></i>
          </IconButton>
        </Header>
         )}
         </Sticky>
         {/* ... */}
       </StickyContainer>

        <Content>
          <div className="page-content" style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
          <Grid className="demo-grid-1" id="landing" onChange={this.handleChange('landing')} style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Landing /></Cell>
          </Grid>
          <Grid className="demo-grid-2" id="projects" ref="projects" onChange={this.handleChange('projects')} style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>

            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Projects /></Cell>

          </Grid>
          <Grid className="demo-grid-3" id="aboutme" ref="aboutme" onChange={this.handleChange('aboutme')} style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><AboutMe /></Cell>
          </Grid>
          <Grid className="demo-grid-4" id="contact" ref="contact" onChange={this.handleChange('contact')} style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Contact /></Cell>
          </Grid>
          </div>
        </Content>
      </Layout>
    </div>
  );
}
}
export default App;
